import TaskItem from "./TaskItem";

const TaskList = ({ tasks }) => {
  console.log(tasks[0].id);
  return (
    <div>
      <h1>Task List</h1>
      <ul>
        {tasks.map((x) => (
          <TaskItem key={x._id} task={x} />
        ))}
      </ul>
    </div>
  );
};

export default TaskList;
